import logo from './logo.svg';
// import './App.css';
import Home from './pages/Home';
import Blogs from './pages/Blogs';

function App1() {
  return (
    <div className="text-8xl text-center text-blue-400 bg-black">
      <h1>Hello World!</h1>
    </div>
  );
}

const App = () => {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/about">About</Link>
            </li>
          </ul>
        </nav>

        <hr />

        <Route exact path="/" component={Home} />
        <Route path="/blogs" component={Blogs} />
      </div>
    </Router>
  );
};

export default App;
